import React, { useState, useEffect } from 'react';
import { View, Text, StyleSheet, FlatList, TouchableOpacity } from 'react-native';
import { useSelector, useDispatch } from 'react-redux';
import { setJournalEntries, addJournalEntry } from '../../store/slices/tarotSlice';
import { getUserJournalEntries } from '../../services/supabase/supabaseClient';
import Button from '../../components/common/Button';

const JournalScreen = ({ navigation }) => {
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [filter, setFilter] = useState('all'); // 'all', 'readings', 'cards', 'affirmations', 'notes'

  const dispatch = useDispatch();
  const journalEntries = useSelector(state => state.tarot.journalEntries);
  const user = useSelector(state => state.auth.user);

  // Sample journal entries data for demo
  const sampleJournalEntries = [
    {
      id: '1',
      date: new Date(2025, 2, 23).toISOString(),
      content: "Today's reading was very insightful. The Fool card reminded me to embrace new beginnings without fear. I'm going to apply this to my new project at work.",
      type: 'reading',
      reading_id: '1',
      reading_name: 'Three Card Spread',
      mood: 'inspired',
      tags: ['work', 'projects', 'growth']
    },
    {
      id: '2',
      date: new Date(2025, 2, 22).toISOString(),
      content: "Reflected on The High Priestess today. I need to trust my intuition more, especially when it comes to making decisions about my relationships.",
      type: 'card',
      card_id: '2',
      card_name: 'The High Priestess',
      mood: 'contemplative',
      tags: ['intuition', 'relationships']
    },
    {
      id: '3',
      date: new Date(2025, 2, 21).toISOString(),
      content: "Today's affirmation: 'I release what no longer serves me and welcome positive change.' This really resonated with me as I've been holding onto some past hurts that I need to let go of.",
      type: 'affirmation',
      affirmation_id: '8',
      mood: 'hopeful',
      tags: ['letting go', 'change', 'healing']
    },
    {
      id: '4',
      date: new Date(2025, 2, 20).toISOString(),
      content: "Had a dream about tarot cards last night. They were floating and speaking to me. I wonder what my subconscious is trying to tell me.",
      type: 'note',
      mood: 'curious',
      tags: ['dreams', 'symbols']
    },
    {
      id: '5',
      date: new Date(2025, 2, 19).toISOString(),
      content: "Did a Celtic Cross reading about my career path. The outcome card was the Ten of Pentacles, which gives me hope that my hard work will lead to long-term success and stability.",
      type: 'reading',
      reading_id: '2',
      reading_name: 'Celtic Cross',
      mood: 'optimistic',
      tags: ['career', 'future', 'success']
    }
  ];

  useEffect(() => {
    fetchJournalEntries();
  }, []);

  const fetchJournalEntries = async () => {
    setLoading(true);
    setError('');

    try {
      if (user && user.id !== 'demo-user') {
        // In a real app, we would fetch from Supabase
        // const { data, error } = await getUserJournalEntries(user.id);

        // if (error) {
        //   throw error;
        // }

        // dispatch(setJournalEntries(data));
      } else {
        // For demo purposes, use sample data
        dispatch(setJournalEntries(sampleJournalEntries));
      }

      setTimeout(() => setLoading(false), 500); // Simulate loading
    } catch (err) {
      console.error('Error fetching journal entries:', err);
      setError('Failed to load journal entries. Please try again.');
      setLoading(false);
    }
  };

  const handleEntrySelect = (entry) => {
    navigation.navigate('JournalEntry', { entryId: entry.id });
  };

  const handleNewEntry = () => {
    navigation.navigate('JournalEntry', { entryId: 'new' });
  };

  const getFilteredEntries = () => {
    if (filter === 'all') {
      return journalEntries;
    } else {
      return journalEntries.filter(entry => entry.type === filter);
    }
  };

  const formatDate = (dateString) => {
    const date = new Date(dateString);
    return date.toLocaleDateString('en-US', { 
      weekday: 'short', 
      year: 'numeric', 
      month: 'short', 
      day: 'numeric' 
    });
  };

  const renderEntryItem = ({ item }) => (
    <TouchableOpacity
      style={styles.entryItem}
      onPress={() => handleEntrySelect(item)}
    >
      <View style={styles.entryHeader}>
        <Text style={styles.entryDate}>{formatDate(item.date)}</Text>
        <View style={styles.entryTypeBadge}>
          <Text style={styles.entryTypeText}>
            {item.type === 'reading' ? 'Reading' : 
             item.type === 'card' ? 'Card' : 
             item.type === 'affirmation' ? 'Affirmation' : 'Note'}
          </Text>
        </View>
      </View>

      {(item.reading_name || item.card_name) && (
        <Text style={styles.entrySubtitle}>
          {item.reading_name || item.card_name}
        </Text>
      )}

      <Text style={styles.entryContent} numberOfLines={3}>
        {item.content}
      </Text>

      {item.mood && (
        <View style={styles.moodContainer}>
          <Text style={styles.moodText}>Mood: {item.mood}</Text>
        </View>
      )}

      {item.tags && item.tags.length > 0 && (
        <View style={styles.tagsContainer}>
          {item.tags.map((tag, index) => (
            <View key={index} style={styles.tagBadge}>
              <Text style={styles.tagText}>{tag}</Text>
            </View>
          ))}
        </View>
      )}
    </TouchableOpacity>
  );

  return (
    <View style={styles.container}>
      <Text style={styles.title}>Journal</Text>

      <View style={styles.filterContainer}>
        <ScrollView horizontal showsHorizontalScrollIndicator={false}>
          <TouchableOpacity
            style={[styles.filterButton, filter === 'all' && styles.filterButtonActive]}
            onPress={() => setFilter('all')}
          >
            <Text style={[styles.filterText, filter === 'all' && styles.filterTextActive]}>All</Text>
          </TouchableOpacity>

          <TouchableOpacity
            style={[styles.filterButton, filter === 'reading' && styles.filterButtonActive]}
            onPress={() => setFilter('reading')}
          >
            <Text style={[styles.filterText, filter === 'reading' && styles.filterTextActive]}>Readings</Text>
          </TouchableOpacity>

          <TouchableOpacity
            style={[styles.filterButton, filter === 'card' && styles.filterButtonActive]}
            onPress={() => setFilter('card')}
          >
            <Text style={[styles.filterText, filter === 'card' && styles.filterTextActive]}>Cards</Text>
          </TouchableOpacity>

          <TouchableOpacity
            style={[styles.filterButton, filter === 'affirmation' && styles.filterButtonActive]}
            onPress={() => setFilter('affirmation')}
          >
            <Text style={[styles.filterText, filter === 'affirmation' && styles.filterTextActive]}>Affirmations</Text>
          </TouchableOpacity>

          <TouchableOpacity
            style={[styles.filterButton, filter === 'note' && styles.filterButtonActive]}
            onPress={() => setFilter('note')}
          >
            <Text style={[styles.filterText, filter === 'note' && styles.filterTextActive]}>Notes</Text>
          </TouchableOpacity>
        </ScrollView>
      </View>

      {loading ? (
        <View style={styles.loadingContainer}>
          <Text style={styles.loadingText}>Loading journal entries...</Text>
        </View>
      ) : error ? (
        <View style={styles.errorContainer}>
          <Text style={styles.errorText}>{error}</Text>
          <Button title="Try Again" onPress={fetchJournalEntries} type="secondary" />
        </View>
      ) : (
        <FlatList
          data={getFilteredEntries()}
          renderItem={renderEntryItem}
          keyExtractor={item => item.id}
          contentContainerStyle={styles.entriesList}
          showsVerticalScrollIndicator={false}
          ListEmptyComponent={
            <View style={styles.emptyContainer}>
              <Text style={styles.emptyText}>No journal entries found</Text>
              <Button 
                title="Create Your First Entry" 
                onPress={handleNewEntry} 
                type="secondary"
                style={styles.emptyButton}
              />
            </View>
          }
        />
      )}

      <TouchableOpacity 
        style={styles.newEntryButton}
        onPress={handleNewEntry}
      >
        <Text style={styles.newEntryButtonText}>+</Text>
      </TouchableOpacity>
    </View>
  );
};

